"""
https://leetcode.com/problems/increasing-triplet-subsequence/

Given an integer array nums, return true if there exists a triple of 
indices (i, j, k) such that i < j < k and nums[i] < nums[j] < nums[k]. If no such indices exists, return false.

Input: nums = [1,2,3,4,5]
Output: true
Explanation: Any triplet where i < j < k is valid.
"""


from typing import Collection


class Solution(object):
    def increasingTriplet(self, nums):
        """
        :type nums: List[int]
        :rtype: bool
        """
        a=nums
        n = len(a)
        # Creating the sorted list
        b = sorted(list(set(a)))
        m = len(b)
    
        # Creating dp table for storing the answers of sub problems
        dp = [[-1 for i in range(m+1)] for j in range(n+1)]
    
        # Finding Longest common Subsequence of the two arrays
        for i in range(n+1):
            for j in range(m+1):
                if i == 0 or j == 0:
                    dp[i][j] = 0
                elif a[i-1] == b[j-1]:
                    dp[i][j] = 1+dp[i-1][j-1]
                else:
                    dp[i][j] = max(dp[i-1][j], dp[i][j-1])
        return dp[-1][-1]
    
    def _increasingTriplet(self, nums):
        from collections import defaultdict
        LIS=defaultdict(lambda :1)
        for i in range(len(nums)-1,-1,-1):
            for j in range(i+1, len(nums)):
                if nums[i]<nums[j]:
                    LIS[i]=max(LIS[i], LIS[j]+1)
                    #LIS[nums[i]]=max(LIS[nums[i]], LIS[nums[j]]+1)
        triplets=max(LIS.values())
        if triplets<3:
            return False
        else:
            return True
    
    def __increasingTriplet(self,nums):
        first = second = float('inf')
        for n in nums:
            if n <= first:
                first = n
            elif n <= second:
                second = n
            else:
                return True
        return False


